import React, { useState } from "react"
// import { Form, Card, Button } from "react-bootstrap"

import FormGroup from '@material-ui/core/FormGroup'
import FormControlLabel from '@material-ui/core/FormControlLabel';
import Checkbox from '@material-ui/core/Checkbox';
// import CheckBoxOutlineBlankIcon from '@material-ui/icons/CheckBoxOutlineBlank';
// import CheckBoxIcon from '@material-ui/icons/CheckBox';

function CriticalWarnSelect(props) {
    const [checked, setChecked] = useState({
        CPR: false,
        stroke: false,
        trauma1: false,
        trauma2: false,
        intubated: false,
        fallWithThinners: false
    })

    const handleChange = (event) => {
        setChecked({ ...checked, [event.target.name]: event.target.checked });
        console.log(checked)
    };
    return (

        <FormGroup row >
            <FormControlLabel
                control={
                    <Checkbox
                        checked={checked.CPR}
                        onChange={handleChange}
                        name="CPR"
                        color="secondary"
                    />
                }
                label="CPR IN PROGRESS"
            />
            <FormControlLabel
                control={
                    <Checkbox
                        checked={checked.stroke}
                        onChange={handleChange}
                        name="stroke"
                        color="secondary"
                    />
                }
                label="STROKE ALERT"
            />
            <FormControlLabel
                control={
                    <Checkbox
                        checked={checked.trauma1}
                        onChange={handleChange}
                        name="trauma1"
                        color="secondary"
                    />
                }
                label="Trauma Level 1"
            />
            <FormControlLabel
                control={
                    <Checkbox
                        checked={checked.trauma2}
                        onChange={handleChange}
                        name="trauma2"
                        color="secondary"
                    />
                }
                label="Trauma Level 2"
            />
            <FormControlLabel
                control={
                    <Checkbox
                        checked={checked.intubated}
                        onChange={handleChange}
                        name="intubated"
                        color="secondary"
                    />
                }
                label="Patient Intubated"
            />
            <FormControlLabel
                control={
                    <Checkbox
                        checked={checked.fallWithThinners}
                        onChange={handleChange}
                        name="fallWithThinners"
                        color="secondary"
                    />
                }
                label="Fall With Blood Thinners"
            />
            <Button size="large" variant="contained" color="primary" >Submit</Button>
        </FormGroup>
    )
}

export default CriticalWarnSelect
